"use strict";
function nabee(minnum, maxnum) {
    const results = [];
    for (let i = minnum; i <= maxnum; i++) {
        results.push(i);
    }
    return results;
}
console.log(nabee(1, 7));
function nagurareya(omax, omini) {
    const nannnimo = [];
    for (let i = omax; i >= omini; i--) {
        nannnimo.push(i);
    }
    return nannnimo;
}
console.log(nagurareya(10, 5));
console.log(nagurareya(1, 3));
